import React ,{Component} from 'react';

class vacaciones extends Component{
    constructor(props){
        super(props);
        this.state={
            vacacion:'De vacaciones'
        }

    }

    render(){
        return(
        <h1>{this.state.vacacion}</h1>
        )
    }
};

export default vacaciones;
